import Card from "../UI/Card";
import classes from "./Cart.module.css";
import CartItem from "./CartItem";

const Cart = (props) => {
  return (
    <Card className={classes.cart}>
      <h2>Your Shopping Cart</h2>
      <ul>
        <CartItem
          item={[
            {
              title: "Apple",
              quantity: 1,
              total: 6,
              price: 6,
              id: "c1",
            },
            {
              title: "Pear",
              quantity: 4,
              total: 24,
              price: 5,
              id: "c2",
            },
          ]}
        />
      </ul>
    </Card>
  );
};

export default Cart;
